import React from 'react';
import { Link } from 'react-router-dom';
import './AdminDashboard.css';
import './TPADashboard.css';

const TPA = () => {
    return (
<div className='vrap'>
<div className="admin-dashboard">
            <aside className="tpa-sidebar">
            </aside>
            <aside className="tpa-sidebar-2">
            </aside>
            <aside className="tpa-sidebar-3">
            </aside>

            <div className="main-content">
                    <h1>TPA ClaimDesk</h1>
                <div className="functions">
                    <div className="function-card">
                        <Link to="/claimlist" className="btn">
                        <h3>Submit Claims</h3>
                        <p></p>
                        </Link>
                    </div>
                    <div className="function-card">

                        <Link to="/products" className="btn"><h3>view Claims</h3><p></p></Link>
                    </div>
                </div>
            </div>
        </div>
</div>
    );
};

export default TPA;
